export default function Admin() {
  return (
    <>
    <NavBarAdmin></NavBarAdmin>
    <section style={{display:'flex', flexDirection:'column'}}>
    <div className='container d-flex justify-content-center align-items-center h-100'>
      <CreateUsers />
      <p>
